        { path: 'completed-interview', element:  <RequireAuth allowedRoles={[ROLES.TECH_INTERVIEWER, ROLES.NON_TECH_INTERVIEWER]} permissions={['can_view_completed_interviews']} > <CompletedInterview />  </RequireAuth>},

